-- ----------------------------
-- Procedure structure for SP_GET_PROCESS_INFO
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_GET_PROCESS_INFO`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `SP_GET_PROCESS_INFO`(
    in  in_process_name varchar(200),
    in  in_execute_time int,
    in  in_partition    varchar(100),
    out on_step         int,
    out on_status       int)
begin
  DECLARE DONE INT DEFAULT 0;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET DONE=1;
  DECLARE EXIT HANDLER FOR SQLEXCEPTION

  BEGIN
    call SP_SET_PROCESS_STATUS(in_process_name, in_execute_time, in_partition, 0, 9);
    SET on_status = 9;
    SET on_step   = 0;
  end;

  BEGIN
    select step_id, status
      into on_step, on_status
      from md_process_control
     where process_name = trim(upper(in_process_name))
       and stat_date = in_execute_time
       and partion_id = in_partition;
     commit;

     IF on_status <> 8 THEN
          call SP_SET_PROCESS_STATUS(in_process_name, in_execute_time, in_partition, 0, 10);
     END IF;
  END;
end;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for SP_SET_PROCESS_STATUS
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_SET_PROCESS_STATUS`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `SP_SET_PROCESS_STATUS`(IN IN_PROCESS_NAME VARCHAR(500),IN IN_STAT_DATE int,IN IN_PARTION_ID varchar(100),IN IN_STEP_ID int,IN IN_STATUS int)
BEGIN
 #声明变量
 DECLARE CONST_DOING INT(2);
 DECLARE CONST_OK    INT(2);
 DECLARE CONST_READY INT(2);
 DECLARE V_ERRORINFO VARCHAR(200);
 DECLARE V_ERRORCODE INT;
 DECLARE V_COUNT     INT;
 #变量初始化
 SET CONST_DOING = 8;
 SET CONST_OK = 0;
 SET CONST_READY = 9;
 #控制表中无此记录
  SELECT count(*) into V_COUNT
    from MD_PROCESS_CONTROL t
   where t.PROCESS_NAME = UPPER(IN_PROCESS_NAME)
     AND t.STAT_DATE = IN_STAT_DATE
     AND t.PARTION_ID = IN_PARTION_ID;
  IF V_COUNT = 0 THEN
  ELSE
    IF IN_STATUS = 10 THEN
        UPDATE MD_PROCESS_CONTROL SET START_TIME=SYSDATE()
               WHERE TRIM(UPPER(PROCESS_NAME)) = TRIM(UPPER(IN_PROCESS_NAME))
                 AND STAT_DATE = IN_STAT_DATE
                 AND PARTION_ID = IN_PARTION_ID;
             COMMIT;
     END IF;
     #更新控制表
         UPDATE MD_PROCESS_CONTROL SET STATUS = IN_STATUS,STEP_ID = IN_STEP_ID
            WHERE TRIM(UPPER(PROCESS_NAME)) = TRIM(UPPER(IN_PROCESS_NAME))
                AND STAT_DATE = IN_STAT_DATE
                AND PARTION_ID = IN_PARTION_ID;
         COMMIT;
  END IF;

 #程序正在执行
  IF IN_STATUS = CONST_DOING THEN
    UPDATE MD_PROCESS_CONTROL SET
      START_TIME = IFNull(START_TIME, SYSDATE()),
      END_TIME = NULL,
      RUN_SECONDS = UNIX_TIMESTAMP(SYSDATE()) - UNIX_TIMESTAMP(IFNULL(START_TIME, SYSDATE()))
    WHERE TRIM(UPPER(PROCESS_NAME)) = TRIM(UPPER(IN_PROCESS_NAME))
      AND   STAT_DATE = IN_STAT_DATE
      AND   PARTION_ID = IN_PARTION_ID;
  END IF;

 #程序报错
 IF IN_STATUS < CONST_OK THEN
    #V_ERRORINFO := TRIM(SUBSTR(mysql_error(), 1, 80));
    UPDATE MD_PROCESS_CONTROL
       SET RUN_SECONDS = UNIX_TIMESTAMP(SYSDATE()) - UNIX_TIMESTAMP(IFNULL(START_TIME, SYSDATE())),
             START_TIME = IFNull(START_TIME, SYSDATE()),
           END_TIME = SYSDATE(),
           ERROR_MSG = CONCAT('存储过程:',IN_PROCESS_NAME,'_步骤',(IN_STEP_ID+1))
     WHERE TRIM(UPPER(PROCESS_NAME)) = TRIM(UPPER(IN_PROCESS_NAME))
       AND STAT_DATE = IN_STAT_DATE
       AND PARTION_ID = IN_PARTION_ID;
 END IF;
 #程序执行成功
 IF IN_STATUS = CONST_OK THEN
    UPDATE MD_PROCESS_CONTROL
       SET RUN_SECONDS = UNIX_TIMESTAMP(SYSDATE()) - UNIX_TIMESTAMP(IFNULL(START_TIME, SYSDATE())),
           START_TIME = IFNull(START_TIME, SYSDATE()),
           END_TIME = SYSDATE(),
           ERROR_MSG = '存储过程成功完成'
     WHERE TRIM(UPPER(PROCESS_NAME)) = TRIM(UPPER(IN_PROCESS_NAME))
       AND STAT_DATE = IN_STAT_DATE
       AND PARTION_ID = IN_PARTION_ID;
  END IF;
  COMMIT;
end;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_st_case_fee_stats
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_st_case_fee_stats`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `sp_st_case_fee_stats`(IN in_stat_date int,OUT rtn_code int,OUT rtn_info varchar(2000))
LABEL_PROC:BEGIN

  # 声明变量 ---------------------------------------------------------------------------------
  DECLARE const_process_name varchar(30) DEFAULT('sp_st_case_fee_stats');
  DECLARE v_step             varchar(20);
  DECLARE v_status           int DEFAULT 0;
  DECLARE v_mon              varchar(2);
  DECLARE v_day              varchar(2);
  DECLARE done               int DEFAULT 0;
  DECLARE sub_done           int DEFAULT 0;

  DECLARE v_case_id          varchar(20);
  DECLARE v_org_id           varchar(20);
  DECLARE v_user_id          varchar(20);
  DECLARE v_case_type        varchar(30);
  DECLARE v_case_sub_type    varchar(30);
  DECLARE v_case_status      varchar(40);

  DECLARE v_fee_item_id      varchar(20);
  DECLARE v_fee_amount       double(10,2);
  DECLARE v_waiver_fee       double(10,2);
  DECLARE v_profit           double(10,2);
  DECLARE v_item_rate        double(5,2);

  DECLARE v_total_fee_amount double(10,2);  -- 总收入
  DECLARE v_total_profit     double(10,2);  -- 净利润
  DECLARE v_total_cost       double(10,2);  -- 总成本
  DECLARE v_total_waiver     double(10,2);  -- 总的优惠减免
  DECLARE v_total_es         double(10,2);  -- 总的有效业绩
  DECLARE v_return_fee       double(10,2);  -- 总返费

  DECLARE c_st_fee CURSOR FOR
    select a.case_id, b.org_id, a.create_user, a.case_type, a.case_sub_type, a.case_status
      from crdt_case_base_info a,
           cfg_user b
     where a.case_status = 'STATUS_124' -- 只获取已结案的案子费用信息
       and a.create_user = b.user_id;

  declare continue handler for not found set done = 1;

  # 异常处理 ---------------------------------------------------------------------------------
  DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
    ROLLBACK;
    SET rtn_code = -1;
    SET rtn_info = CONCAT('存储过程:',const_process_name,'_异常步骤：',v_step);
    CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, -1);
  END;

  # 变量初始化 ---------------------------------------------------------------------------------
  set rtn_code = 0;
  set v_step   = -1;

  set v_mon = substr(in_stat_date,5,2);
  set v_day = substr(in_stat_date,7,2);

  # 控制表中无此记录 --------------------------------------------------------------------------
  CALL SP_GET_PROCESS_INFO(const_process_name,in_stat_date,0,v_step,v_status);

  IF v_status = 8 THEN
     SET rtn_code = -2;
     SET rtn_info = CONCAT(const_process_name,'进程正在运行');
     LEAVE LABEL_PROC;#退出过程
  END IF;

  SET v_step = 0;
  CALL SP_SET_PROCESS_STATUS(const_process_name,in_stat_date,0,v_step,8);

  # 清理分区 ---------------------------------------------------------------------------------
  SET @V_SQL = CONCAT('ALTER TABLE st_case_fee_stats TRUNCATE PARTITION P_MD_',v_mon,v_day);
  PREPARE STMT FROM @V_SQL;
  EXECUTE STMT;
  DEALLOCATE PREPARE STMT;
  COMMIT;

  # 程序正在执行 ------------------------------------------------------------------------------
  OPEN c_st_fee;
    c_st_fee: LOOP
    set done = 0;
    FETCH c_st_fee INTO v_case_id,v_org_id,v_user_id,v_case_type,v_case_sub_type,v_case_status;

			if done = 1 then 
				leave c_st_fee;
			end if;

			set v_total_fee_amount = 0.0;
			set v_total_profit = 0.0;
			set v_total_cost = 0.0;
			set v_total_waiver = 0.0;
			set v_total_es = 0.0;
      set v_return_fee = 0.0;

      BEGIN
        DECLARE c_sub_query CURSOR FOR 
          select a.fee_item_id, a.fee_amount, a.waiver_fee, a.profit, b.item_rate/100
				    from crdt_fee_item_rel a,
						     cfg_fee_item b
			     where a.case_id = v_case_id
				     and a.fee_item_id = b.item_id;

        declare continue handler for not found set sub_done = 1;

        open c_sub_query;
          c_sub_query: loop
          set sub_done = 0;

          fetch c_sub_query into v_fee_item_id,v_fee_amount,v_waiver_fee,v_profit,v_item_rate;
			      if sub_done = 1 then 
			        leave c_sub_query; 
			      end if;

            if v_fee_item_id = '' then
				      set v_return_fee = v_return_fee + v_fee_amount;
              set v_total_cost = v_total_cost + v_return_fee;
			      end if;

			      set v_total_fee_amount = v_total_fee_amount + v_fee_amount;
			      set v_total_cost = v_total_cost + (v_profit * v_item_rate);
			      set v_total_cost = v_total_cost + v_waiver_fee;
            set v_total_waiver = v_total_waiver + v_waiver_fee;

        end loop c_sub_query;
        close c_sub_query;
      END;

			set v_total_profit = v_total_fee_amount - v_total_cost;
      set v_total_es = v_total_fee_amount - v_total_cost + v_return_fee;

                    mon_num,
                    day_num,
                    org_id,
                    user_id,
                    case_type,
                    case_sub_type,
                    case_status,
                    case_total_fee,
                    case_cost,
                    case_waiver,
                    case_net_profit,
                    case_es)
      values(v_mon,
             v_day,
             v_org_id,
             v_user_id,
             v_case_type,
             v_case_sub_type,
             v_case_status,
             v_total_fee_amount,
             v_total_cost,
             v_total_waiver,
             v_total_profit,
             v_total_es);

  end loop c_st_fee;
  close c_st_fee;

  commit;

  SET rtn_code = 0;
  SET rtn_info = CONCAT(const_process_name,'完成');
  CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, 0);
end
;;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_st_case_person_stats
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_st_case_person_stats`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `sp_st_case_person_stats`(OUT RTN_CODE INT, OUT RTN_INFO VARCHAR(2000), IN IN_STAT_DATE  INT)
LABEL_PROC:BEGIN

  # 声明变量 ---------------------------------------------------------------------------------
  DECLARE const_process_name varchar(30) DEFAULT('sp_st_case_person_stats');
  DECLARE v_step             varchar(20);
  DECLARE v_status           int DEFAULT 0;
  DECLARE v_mon              varchar(2);
  DECLARE v_day              varchar(2);
  DECLARE done               int DEFAULT 0;
  DECLARE sub_done           int DEFAULT 0;

  DECLARE v_user_id          varchar(20);

  DECLARE v_case_num         double(10,2);
  DECLARE v_return_num       double(10,2);
  DECLARE v_pass_rate        double(10,2);
  DECLARE v_return_rate      double(10,2);

  DECLARE v_diff_time        int;
  DECLARE v_total_tm         int;
  DECLARE v_avg_tm           double(10,2);
  DECLARE v_min_tm           int;
  DECLARE v_max_tm           int;

  DECLARE c_st_person CURSOR FOR
    select distinct a.user_id
      from cfg_user_role a,
           cfg_user b
     where b.status = 'VALID'
       and a.user_id = b.user_id
       and a.role_id in ('R0201','R0501');

  declare continue handler for not found set done = 1;

  # 异常处理 ---------------------------------------------------------------------------------
  DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
    ROLLBACK;
    SET rtn_code = -1;
    SET rtn_info = CONCAT('存储过程:',const_process_name,'_异常步骤：',v_step,'_user:', v_user_id);
    CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, -1);
  END;

  # 变量初始化 ---------------------------------------------------------------------------------
  set rtn_code = 0;
  set v_step   = -1;

  set v_mon = substr(in_stat_date,5,2);
  set v_day = substr(in_stat_date,7,2);

  # 控制表中无此记录 --------------------------------------------------------------------------
  CALL SP_GET_PROCESS_INFO(const_process_name,in_stat_date,0,v_step,v_status);

  IF v_status = 8 THEN
     SET rtn_code = -2;
     SET rtn_info = CONCAT(const_process_name,'进程正在运行');
     LEAVE LABEL_PROC;#退出过程
  END IF;

  SET v_step = 0;
  CALL SP_SET_PROCESS_STATUS(const_process_name,in_stat_date,0,v_step,8);

  # 清理分区 ---------------------------------------------------------------------------------
  SET @V_SQL = CONCAT('ALTER TABLE st_case_person_stats TRUNCATE PARTITION P_MD_',v_mon,v_day);
  PREPARE STMT FROM @V_SQL;
  EXECUTE STMT;
  DEALLOCATE PREPARE STMT;
  COMMIT;

  # 程序正在执行 ------------------------------------------------------------------------------
  SET v_step = 0;
  OPEN c_st_person;
    c_st_person: LOOP
    set done = 0;
    FETCH c_st_person INTO v_user_id;

			if done = 1 then 
				leave c_st_person;
			end if;

      select ifnull(count(distinct case_id),0),
             ifnull(sum(case when case_status = 'STATUS_115' then 1 else 0 end),0)
        into v_case_num, v_return_num
        from crdt_case_base_info
       where create_user = v_user_id;

       SET v_step = v_step + 1;

      if v_case_num <> 0 THEN
        set v_pass_rate = ((v_case_num - v_return_num) / v_case_num) / 100;
        set v_return_rate = (v_return_num / v_case_num) / 100;

        set v_total_tm = 0;

				BEGIN
					DECLARE c_sub_query CURSOR FOR 
						select ifnull(DATEDIFF(modify_time, create_time),0)
							from crdt_case_base_info
						 where create_user = v_user_id
							 and case_status = 'STATUS_124';

					declare continue handler for not found set sub_done = 1;

					open c_sub_query;
						c_sub_query: loop
						set sub_done = 0;

						fetch c_sub_query into v_diff_time;
							if sub_done = 1 then 
								leave c_sub_query; 
							end if;

							set v_total_tm = v_total_tm + v_diff_time;
					end loop c_sub_query;
					close c_sub_query;

					if v_case_num <> 0 then
						set v_avg_tm = v_total_tm / v_case_num;
					ELSE
						set v_avg_tm = 0.00;
					end if;

				END;

				set v_min_tm = 0;
				set v_max_tm = 0;
				select ifnull(min(DATEDIFF(modify_time, create_time)),0), 
							 ifnull(max(DATEDIFF(modify_time, create_time)),0)
					into v_min_tm, v_max_tm
					from crdt_case_base_info
				 where create_user = v_user_id
					 and case_status = 'STATUS_124';        

      ELSE
        set v_pass_rate = 0.00;
        set v_return_rate = 0.00;
        -- set v_total_tm = 0;
        set v_min_tm = 0;
        set v_max_tm = 0;
        set v_avg_tm = 0;
      end if;

      values(v_mon, v_day, v_user_id, v_case_num, v_pass_rate, v_return_rate, v_avg_tm, v_min_tm, v_max_tm);

  end loop c_st_person;
  close c_st_person;

  commit;

  SET rtn_code = 0;
  SET rtn_info = CONCAT(const_process_name,'完成');
  CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, 0);

END
;;
;;
delimiter ;

