  #控制表中无此记录
  CALL SP_GET_PROCESS_INFO(const_process_name,in_stat_date,0,v_step,v_status);

  IF v_status = 8 THEN
     SET rtn_code = -2;
     SET rtn_info = CONCAT(const_process_name,'进程正在运行');
     LEAVE LABEL_PROC;#退出过程
  END IF;

  SET v_step = 0;
  CALL SP_SET_PROCESS_STATUS(const_process_name,in_stat_date,0,v_step,8);

  #清理分区
  SET @V_SQL = CONCAT('ALTER TABLE st_case_stats TRUNCATE PARTITION P_MD_',v_mon,v_day);
  PREPARE STMT FROM @V_SQL;
  EXECUTE STMT;
  DEALLOCATE PREPARE STMT;
  COMMIT;

  #程序正在执行
  select v_mon, v_day, b.org_id, a.create_user, a.case_type, a.case_sub_type, a.case_status, count(*)
    from crdt_case_base_info a,
         cfg_user b
   where a.create_user = b.user_id
     and a.case_status = 'STATUS_112'
  group by v_mon, v_day, b.org_id, a.create_user, a.case_type, a.case_sub_type, a.case_status;

  commit;

  CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, 8);
  
  SET rtn_code = 0;
  SET rtn_info = CONCAT(const_process_name,'完成');
  CALL SP_SET_PROCESS_STATUS(const_process_name, in_stat_date, 0, v_step, 0);
end;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
